const express = require("express");
const app = express();
const mysql = require("mysql2");
require("dotenv").config();

const pool = mysql
  .createPool({
    host: process.env.MYSQL_HOST,
    user: process.env.MYSQL_USER,
    password: process.env.MYSQL_PASSWORD,
    database: process.env.MYSQL_DATABASE,
    enableKeepAlive: true,
  })
  .promise();

pool.getConnection((err, connection) => {
  if (err) {
    console.error("Error connecting to the database:", err);
    return;
  }
  console.log("Connected to the database");
  connection.release();
});

// Delete thet data from previous simulations
async function deleteSimulationData() {
  try {
    await pool.query("SET FOREIGN_KEY_CHECKS = 0");
    console.log("Foreign key checks disabled.");

    await pool.query("TRUNCATE TABLE Vlak_Vagon");
    console.log("Table Vlak_Vagon truncated.");

    await pool.query("TRUNCATE TABLE Vlak_Postaja");
    console.log("Table Vlak_Postaja truncated.");

    await pool.query("TRUNCATE TABLE Vlak");
    console.log("Table Vlak truncated.");

    await pool.query("SET FOREIGN_KEY_CHECKS = 1");
    console.log("Foreign key checks enabled.");
  } catch (error) {
    console.error("Error executing TRUNCATE query:", error);
  }
}

deleteSimulationData();

// Insert new simulation data
async function insertSimulationData(vlaki, vagoni, postanki) {
  await new Promise((resolve) => setTimeout(resolve, 10000));
  try {
    await pool.query(vlaki);
    await pool.query(postanki);
    await pool.query(vagoni);
    console.log("DATA INSERTED");
  } catch (error) {
    console.error("Error executing INSERT query:", error);
  }
}

insertSimulationData(vlaki, vagoni, postanki);

function getRandomDelay() {
  const min = 4000;
  const max = 8000;
  return Math.floor(Math.random() * (max - min + 1)) + min;
}
// Function to execute a batch of update queries
async function executeBatchUpdates(queries) {
  for (const query of queries) {
    try {
      const result = await pool.query(query);
      console.log("Update successful:", result);
    } catch (error) {
      console.error("Error executing update query:", error);
    }
  }
}

// Function to process updates in batches of 2
async function processUpdates() {
  await new Promise((resolve) => setTimeout(resolve, 20000));
  console.log("Begining simulation");
  for (let i = 0; i < updatePostanki.length; i += 2) {
    // Get the current batch of 2 queries
    const batch = updatePostanki.slice(i, i + 2);

    await executeBatchUpdates(batch);

    // Wait for a random delay before the next pair of queries
    if (i + 2 < updatePostanki.length) {
      const delay = getRandomDelay();
      console.log(`Waiting for ${delay / 1000} seconds...`);
      await new Promise((resolve) => setTimeout(resolve, delay));
    }
  }

  console.log("Simulation completed.");
}

// Start processing the updates
processUpdates();

